INSERT [dbo].[PHIM] ([MaPhim], [TenPhim], [Thoiluong], [Daodien], [DienvienChinh], [HangSanxuat], [NuocSanxuat], [HinhAnh], [MoTa], [NgayKhoiChieu]) VALUES (N'P01', N'Tee Yod: Quỷ Ăn Tạng Phần 2', 111, N'Taweewat Wantha', N'Nadech Kugimiya, Denise Jelilcha Kapaun, Mim Rattawadee Wongthong, Junior Kajbhunditt Jaidee, Friend Peerakrit Phacharaboonyakiat, Nutthatcha Jessica Padovan', N'Five Star Production', N'Thái Lan', , N'Ba năm sau cái chết của Yam, Yak vẫn tiếp tục săn lùng linh hồn bí ẩn mặc áo choàng đen. Gặp một người đàn ông có triệu chứng giống Yam, Yak phát hiện ra người bảo vệ linh hồn, pháp sư ẩn dật Puang, sống trong một khu rừng đầy nguy hiểm...', CAST(N'2024-10-18' AS Date))
INSERT [dbo].[PHIM] ([MaPhim], [TenPhim], [Thoiluong], [Daodien], [DienvienChinh], [HangSanxuat], [NuocSanxuat], [HinhAnh], [MoTa], [NgayKhoiChieu]) VALUES (N'P02', N'Cô Dâu Hào Môn', 114, N'Vũ Ngọc Đãng', N'Uyển Ân, Samuel An, Thu Trang, Lê Giang, Kiều Minh Tuấn, NSND Hồng Vân', N'16 Films', N'Việt Nam', , N'NPhim lấy đề tài làm dâu hào môn và khai thác câu chuyện môn đăng hộ đối, lối sống và quy tắc của giới thượng lưu dưới góc nhìn hài hước và châm biếm.', CAST(N'2024-10-10' AS Date))
INSERT [dbo].[PHIM] ([MaPhim], [TenPhim], [Thoiluong], [Daodien], [DienvienChinh], [HangSanxuat], [NuocSanxuat], [HinhAnh], [MoTa], [NgayKhoiChieu]) VALUES (N'P03', N'Domino: Lối Thoát Cuối Cùng', 103, N'Nguyễn Phúc Huy Cương', N'Thuận Nguyễn, Quốc Cường, Huỳnh Anh Tuấn, Henry Nguyễn, Cát Hạ', N'Galaxy Studio', N'Việt Nam', , N'Sau khi cha bị kẻ ác sát hại, từ người ngoài cuộc, An (Thuận Nguyễn) từng bước bị kéo vào cuộc chiến của các phe đảng xã hội đen. An một mình sẽ phải đối mặt với những nguy hiểm đe dọa đến cả tính mạng.', CAST(N'2004-11-10' AS Date))
INSERT [dbo].[PHIM] ([MaPhim], [TenPhim], [Thoiluong], [Daodien], [DienvienChinh], [HangSanxuat], [NuocSanxuat], [HinhAnh], [MoTa], [NgayKhoiChieu]) VALUES (N'P04', N'Robot Hoang Dã', 102, N'Chris Sanders', N'Lupita Nyong''o, Pedro Pascal, Catherine O’hara, Bill Nighy', N'Warner Bros', N'Mỹ', , N'Cuộc phiêu lưu hoành tráng theo chân hành trình của một robot — đơn vị ROZZUM 7134, gọi tắt là Roz. Roz vô tình dạt vào hoang đảo sau một sự cố và nơi đây trở thành địa điểm sống mới của cô...', CAST(N'2024-11-10' AS Date))
INSERT [dbo].[PHIM] ([MaPhim], [TenPhim], [Thoiluong], [Daodien], [DienvienChinh], [HangSanxuat], [NuocSanxuat], [HinhAnh], [MoTa], [NgayKhoiChieu]) VALUES (N'P05', N'Joker: Folie À Deux Điên Có Đôi', 138, N'Todd Phillips', N'Joaquin Phoenix, Zazie Beetz, Lady Gaga', N'Warner Bros', N'Mỹ', , N'“Joker: Folie à Deux” đưa Arthur Fleck đến trại tâm thần Arkham trong khi chờ xét xử cho những tội ác của hắn với tư cách là Joker. Trong lúc vật lộn với hai bản ngã của mình...', CAST(N'2024-10-04' AS Date))
